import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import "./character_database.js";
import character_database from "./character_database.js";

let selected_characters = [1];

function App() {
  const [hp_ally_char_1, set_ally_hp_char_1] = useState(100);
  const [hp_enemy_char_1, set_enemy_hp_char_1] = useState(100);
  const [character_one_state, set_character_one_state] = useState({});
  let character_one = character_database.find(
    element => element.id == selected_characters[0]
  );
  set_character_one_state(character_one);

  return (
    <div className="App">
      <label>Ally:{hp_ally_char_1}</label>
      <img>{character_one_state.ability_one_image}</img>
      <img>{character_one_state.ability_two_image}</img>
      <img>{character_one_state.ability_three_image}</img>
      <img>{character_one_state.ability_four_image}</img>
      <label>Enemy:{hp_enemy_char_1}</label>
    </div>
  );
}

export default App;
